// ==UserScript==
// @name         Show hidden torrents from nyaa.se
// @namespace    https://greasyfork.org/pt-BR/users/26158-pixelrafael
// @version      1.0
// @description  This script shows hidden torrents on nyaa website.
// @author       Rafael Moreira Fonseca
// @match        http://www.nyaa.se/
// @match        http*nyaa.se/
// @require      https://ajax.googleapis.com/ajax/libs/jquery/1.6.4/jquery.min.js
// @icon         http://files.nyaa.se/favicon.png
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/16927/Show%20hidden%20torrents%20from%20nyaase.user.js
// @updateURL https://update.greasyfork.org/scripts/16927/Show%20hidden%20torrents%20from%20nyaase.meta.js
// ==/UserScript==

$(document).ready(function(){
    
    var imgscript = 'data:image/png;base64,';
    var last = $(".tlistname:first").children().attr("href").split("=");
    var lastParse = parseInt(last[2].trim());
    
    for (i = 1; i < 25; i++) {
        
        var link = "http://www.nyaa.se/?page=download&tid="+(lastParse+i);
        
        $.ajax({
            url:link,
            type:'GET',
            success: function(data){
                var torrentdata = data.split(":");
                for (i = 0; i < torrentdata.length; i++) {
                    if(torrentdata[0].indexOf("html") > -1){
                    }else{
                        if(torrentdata[i].indexOf("name") > -1){
                            $(".tlist .tlisthead").after('<tr class="tlistrow" style="background:#f90;"><td class="tlisticon"><a href="http://www.nyaa.se/?cats=1_38"><img src="'+imgscript+'" alt="None"></a></td><td class="tlistname"><a href="'+this.url+'">'+torrentdata[i+1].slice(0,-2)+'</a></td><td class="tlistdownload"><a href="'+this.url+'" title="Download" rel="nofollow"><img src="http://files.nyaa.se/www-dl.png" alt="DL"></a></td><td class="tlistsize">??? MiB</td><td class="tlistsn">0</td><td class="tlistln">0</td><td class="tlistdn">0</td><td class="tlistmn">0</td></tr>');
                        }
                    }
                }
            }
        });
        
    }
    
});
